import React, { Component } from "react";

interface ChipProps {
    children: React.ReactNode; 
    onClick?: () => void; 
    className?: string; 
}

class Chip extends Component<ChipProps> {
      
    render() {
        return (
            <button 
                onClick={this.props.onClick}
                className={`w-16 md:w-24 p-1 rounded-2xl text-xs md:text-sm font-medium bg-neutral-50 border border-neutral-300 hover:border-neutral-400 focus:border-none focus:text-white text-neutral-500 hover:text-gray-600 ${this.props.className}`}>
                    {this.props.children}
            </button>
        );
    }
}

export default Chip;
